import React from 'react';
import './services.css'
import plus from '../../../images/plus.png'

const Services = () => {
    return (
        <section className='container'>
            <div className='service_h2'>
                <h2>Услуги</h2>
                <div className='service_img'>
                    <h6>Сайты</h6>
                    <img src={plus} alt="" />
                </div>

            </div>

        </section>
    );
};

export default Services;
